import { View, Text, StyleSheet } from "react-native";

const Add = () => {
  console.log('1')
  return (
    <View style={styled.addContainer}>
      <Text style={styled.addText}>Add</Text>
    </View>
  );
};

const styled = StyleSheet.create({
  addContainer: {},
  addText: {
    fontSize: 24,
    color: "black",
  },
});

export default Add;
